import React from "react";
import styled from "styled-components";


const NavStyle = styled.nav`
    min-height: 32px;
    height: fit-content;
    display: flex;
    flex-direction: column;
    maring: 0;
    padding: 0;
`;

const StyleA = styled.a`
    color: #f1f1f1;
    text-decoration: none;
    font-family: "Mulish", sans-serif;
    font-optical-sizing: auto;
    font-weight: 600;
    font-style: normal;
    align-items: center;
    justify-content: center;
    font-size: 16px;
    display: block;
`;

const StyleA2 = styled.a`
    color: #e2d351;
    text-decoration: none;
    font-family: "Mulish", sans-serif;
    font-optical-sizing: auto;
    font-weight: 600;
    font-style: normal;
    align-items: center;
    justify-content: center;
    font-size: 16px;
    display: block;
    justify-self: center;
    text-align: cetner;
`;

const StyledSep = styled.div`
    width: 2px;
    height: 26px;
    background-color: #f1f1f1;
    display: block;
`;

const StyledSep2 = styled.div`
    width: 2px;
    height: 26px;
    background-color: #265CAE;
    display: block;
`;

const Span1 = styled.span`
    display: flex;
    background-color: #265CAE;
    min-height: 32px;
    width: 100%;
    height: fit-content;
    color: #f1f1f1;
    justify-content: space-between;
    align-items: center;
    padding: 0;
    margin: 0;
`;

export default function MainNav(){
    return(
        <NavStyle>
            <Span1>
                <StyledSep2></StyledSep2>
                <StyleA2 href="/">Add a <br/>Dream</StyleA2>
                <StyledSep></StyledSep>
                <StyleA href="/" style={{color: "#808080"}} >My Profile</StyleA>
                <StyledSep></StyledSep>
                <StyleA href="/journal-page">Journal</StyleA>
                <StyledSep></StyledSep>
                <StyleA href="/" style={{color: "#808080"}}>Reports</StyleA>
                <StyledSep2></StyledSep2>
            </Span1>
        </NavStyle>
    )
};
